import React, { Component } from 'react';
import { NavLink } from 'react-router-dom'

import './navbarStyle.css'
class NavBar extends Component {
    state = {}
    render() {
        return ( 



        <div>

<nav className="navbar navbar-expand-lg navbar-light bg-light">
    
  <font   className="navbar-brand" href="#">Navbar</font>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>
  <div className="collapse navbar-collapse" id="navbarNav">
    <ul className="navbar-nav">
      <li className="nav-item active">
      <NavLink className="nav-link" path = { "/home" } > Home <span className="sr-only">(current)</span> </NavLink>  
      </li>
      <li className="nav-item">
      <NavLink className="nav-link" path = { "/skils" } > Skils </NavLink>  
      </li>
      <li className="nav-item">
      <NavLink  className="nav-link text-light" path = { "/contactUs" } > Contact Us </NavLink>  
      </li>
   
    </ul>
  </div>
</nav>

           
            </div>




        );
    }
}

export default NavBar;
